import React from 'react';
import Header from './Components/Header';
import CitySelect from './Components/CitySelect';
import SpotifyEmbed from './Components/SpotifyEmbed';


function App() {

  const cityOption = [
    {
      label: "New York",
      value: "new-york",
      stateAbbr: "NY"
    },
    {
      label: "Los Angeles",
      value: "los-angeles",
      stateAbbr: "CA"
    },
    {
      label: "Columbus",
      value: "columbus",
      stateAbbr: "OH"
    }
  ];

  return (
    <div className="h-full">
      <Header />
      <CitySelect />
      <SpotifyEmbed />
    </div>
  );
}

export default App;
